import * as React from 'react';
import './fonts.css';
import { background, secondary } from './colors.js';
import { makeStyles } from '@material-ui/core/styles';
import { Typography, button } from '@mui/material';

import Button from '@mui/material/Button';

const useStyles = makeStyles((theme) => ({
  textTheme: {
    color: secondary,
    fontWeight: 'bold',
    fontFamily: 'Montserrat',
    fontSize: '1.75em',
    letterSpacing: '0.1em',
    display: 'block'},
}));

const textTheme = {
  color: secondary,
  fontWeight: 'bold',
  fontFamily: 'Montserrat',
  fontSize: '0.75em',
  letterSpacing: '0.1em',
  marginTop: '20px',
  marginRight: '50px',
  display: 'block'
};
const firstLetter = { fontSize: '1.3em' };

const titleText = {
  display: 'flex',
  justifyContent: 'center',
  alignItems: 'center',
  flex: 1,
};

function TitleContent() {
  const classes = useStyles();
  return (
    <div style={titleText}>
      <p>This is centered text on the page.</p>
    </div>
  );
}

export default TitleContent;
